export default function guardrail(mathFunction){
	const queue = [];
	let message = "Guardrail was processed";

	try {
		queue.push(mathFunction());
	}
	catch (err){
		queue.push(err.toString());
	}
	finally {
		queue.push(message);
	}

	return queue;
}
